1	About Us		1	<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">Our Staff has been providing professional &amp; trusted pet care from last 7 years. Since then, we have cared for thousands of pets, as well as some homes and yards. Over the years, multiple services were added to help you.<br style="box-sizing: border-box;" />Our team has taken numerous measures to ensure your pets are always in a safe, balanced and nurturing environment. With years of experience, knowledge and service, we have, and continuously learn and update our practices to keep your pet friends happy, healthy, balanced and fun loving.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">We look forward to a lifetime of helping you care for your pet friends, home and yard.</p>		\N	\N	\N	2023-05-31 01:57:13	2023-08-20 09:17:15
3	Privacy		1	<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;">Dog Boarding</strong>-Check in directly at the kennels,Nigeria.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;">Cat Boarding</strong>-Check in directly at the cattety,Nigeria.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">Office hours 7am-6pm. Collecton or dropping off out of these hours,plese call in advance to arrange.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;">Collection</strong>:if collection is booked,we will call you the day before arrval to arrange a convenient time.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;">Delivery</strong>: if you have fook for delivery please contact us when you arrive back home so we can arrange a convenient time</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;">Vaccination Certificate</strong>:The only thing you need to bring with you is the up-to-date vaccination card for all of your pets.We will no be able tto allow your pets to board if we do not have this on site for the duration of their stay.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;">Frontline-Flea &amp; Tick treatment:</strong>All pets bording will be adminstered frontline upon arrival unless owner provides on arrival.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;">Vaccinations:(General pet laws)</strong><br style="box-sizing: border-box;" />It is compulsory to vaccinate dogs and cats of all ages. Dogs and puppies must be vaccinated against the following:</p>\r\n<ul style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">\r\n<li style="box-sizing: border-box; width: 1100px;">Distemper</li>\r\n<li style="box-sizing: border-box; width: 1100px;">Hepatitis</li>\r\n<li style="box-sizing: border-box; width: 1100px;">Leptospirosis</li>\r\n<li style="box-sizing: border-box; width: 1100px;">Parainfluenza</li>\r\n<li style="box-sizing: border-box; width: 1100px;">parvovirus and rabies</li>\r\n</ul>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">Cats and kittens must be vaccinated against:</p>\r\n<ul style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">\r\n<li style="box-sizing: border-box; width: 1100px;">Calicivirus</li>\r\n<li style="box-sizing: border-box; width: 1100px;">Panleukopenia (also known as feline distemper)</li>\r\n<li style="box-sizing: border-box; width: 1100px;">Rabies</li>\r\n<li style="box-sizing: border-box; width: 1100px;">Rhinotracheitis</li>\r\n</ul>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">&nbsp;</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;">Failure to collect family pet:</strong>If the owner fails to collecat their pet within 7 days of the agreed departure date from our facility,this will result in our re-homin,selling or diposing of the animal at our discretion.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;">General Care</strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">Any medicines will be given as per instructions to animals boarding with us, but it must be understood that&nbsp;<br style="box-sizing: border-box;" />we are NOT a Veterinary Kennels.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">In the event of illness, including kennel cough, or injury, your cat or dog will be taken to Heath and Reach&nbsp;<br style="box-sizing: border-box;" />Veterinary Surgery, and all charges incurred will be paid by the customer.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">Please note, dogs/cats showing signs of a contagious disease i.e. Ringworm, Fox Mange etc., will not be&nbsp;<br style="box-sizing: border-box;" />accepted for boarding.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">Any owner requiring that their dogs/cats share accommodation does so at their own risk.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">By agreeing to our Terms &amp; conditions you have confirmed you are happy for us to use photographs of your&nbsp;<br style="box-sizing: border-box;" />pet for publicity.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">Please note all of our new dog customers along with the dog they wish to board must visit the&nbsp;<br style="box-sizing: border-box;" />kennels/cattery before the first boarding date. Failure to make a visit may result in us NOT taking your dog.&nbsp;<br style="box-sizing: border-box;" />We will assess your dog to make sure we are happy to kennel them.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">I agree to the terms and conditions of boarding at&nbsp;<strong>House of Pluto</strong>.</p>		\N	\N	\N	2023-05-31 01:57:35	2023-08-20 09:19:14
2	Terms and conditions		1	<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;"><em style="box-sizing: border-box;">Vaccination:</em></strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">No animal will be accepted unless proof of an up to date vaccination is provided prior to or upon arrival. This is required by law. House of Pluto for Cats and Dogs also requires up to date Kennel Cough vaccination for dogs.you for choosing Pet Care Kennels and Cattery to take care of your Cat and Dog.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><em style="box-sizing: border-box;">&nbsp;<strong style="box-sizing: border-box;">Flea /TicksTreatments:</strong></em></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">All Animals must be covered by a knownTicks and flea treatment, such as&nbsp;<strong style="box-sizing: border-box;">Frontline/Advantix&nbsp;</strong>before they are boarded. These products have varying lengths of effectiveness. Animals that arrive with fleas will be administered such a product and charged accordingly.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;"><em style="box-sizing: border-box;">Veterinary Fees:</em></strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">You agree that we may take your dog to a veterinary surgeon if we suspect he or she is not well and you agree to accept full responsibility for payment of any veterinary fees incurred.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;"><em style="box-sizing: border-box;">Payment:</em></strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">We will require full payment for the booking by cash when you leave your animal with us.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;"><em style="box-sizing: border-box;">Non Collocation:</em></strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">Pet Care Boarding for Cats and Dogs reserves the right to re-home any animal not collected within 15 days of the stated departure dates if no communication from the owner, or owner&rsquo;s agent, is received and if efforts to contact the owner fail.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;"><em style="box-sizing: border-box;">Socialization&nbsp; and Exercises</em></strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">I agree to my dog(s) being exercised under supervision with other compatible dogs within a secure area.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;"><em style="box-sizing: border-box;">Opening hours</em></strong></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">Drop and collect between 07.00 to 12.00 + 13.00 to 18.00 &ndash; 7 days.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;"><strong style="box-sizing: border-box;"><em style="box-sizing: border-box;">Our Commitment To You</em></strong><em style="box-sizing: border-box;">:</em></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; font-size: 17px; line-height: 34px; color: #989797; font-family: Lato, sans-serif;">We aim to meet the highest standards of care in the course of operating as a pet care company and promise to use all reasonable endeavor&nbsp; in providing a suitable care to board your dog/cat based on the information provided by you in the Booking Form.</p>		\N	\N	\N	2023-05-31 01:57:26	2023-08-20 09:21:31
